import Link from 'next/link';
import { useRouter } from 'next/router';
import React from 'react';
import { Button } from '../../components/Button';
import { Panel } from '../../components/Panel';
import faker from 'faker';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faThumbsDown } from '@fortawesome/free-solid-svg-icons';

const ReputationSubApp = () => {
	const router = useRouter();
	return (
		<div className="pt-6 grid grid-cols-7 gap-6">
			<div className="col-span-5">
				<Panel header={{ content: 'Profile Posts' }}>
					<table className="table-fixed w-full border-collapse">
						<thead className="text-left">
							<tr className="border-b-2 border-primary-border pb-2">
								<th className="w-1/5">Name</th>
								<th className="w-1/5">Type</th>
								<th className="w-3/5">Comment</th>
							</tr>
						</thead>
						<tbody>
							{[
								{
									name: faker.name.findName(),
									type: -1,
									content: faker.lorem.text(),
								},
							].map((rep) => {
								return (
									<tr className="border-b-2 last:border-b-0 border-primary-border">
										<td className="py-4">{rep.name}</td>
										<td className="">
											{rep.type < 0 ? (
												<div className="flex items-center space-x-2 text-negative-cta">
													<FontAwesomeIcon icon={faThumbsDown} />
													<p className="font-medium">Negative</p>
												</div>
											) : rep.type > 0 ? (
												-1
											) : (
												0
											)}
										</td>
										<td className="py-4">
											<p className="overflow-hidden line-clamp-2">
												Lorem ipsum dolor sit amet, consectetur adipiscing elit.
												Proin facilisis libero sit amet lobortis pellentesque.
												Integer congue eros sit amet malesuada ornare. Quisque
												convallis suscipit tellus, ac feugiat nisi lobortis
												quis. Vestibulum tempor justo id posuere aliquet. Nulla
												maximus erat dolor, eget euismod dui mattis quis.
												Vivamus velit enim, sollicitudin sit amet tellus vitae,
												pulvinar lacinia arcu. Sed vel sapien in mi elementum
												lacinia. Suspendisse molestie nisl a eros ultrices
												euismod. Donec eget faucibus lacus, et pretium dui.
												Proin dui lacus, lacinia sed lacus molestie, tempus
												mollis velit. Phasellus ut pretium libero. Pellentesque
												laoreet dolor libero, sit amet accumsan neque placerat
												eu. Sed eget tempus turpis, nec cursus felis.
												Pellentesque at nisl ac ante maximus feugiat aliquam
												vitae felis.
											</p>
										</td>
									</tr>
								);
							})}
						</tbody>
					</table>
				</Panel>
			</div>
			<div className="col-span-2">
				<Panel compact={true} header={{ content: 'Reputation Overview' }}>
					<ul className="space-y-2">
						<li className="flex items-center justify-between font-medium">
							<p>Positive</p>
							<p className="text-positive-cta">22 (98%)</p>
						</li>
						<li className="flex items-center justify-between font-medium">
							<p>Neutral</p>
							<p>1 (1%)</p>
						</li>
						<li className="flex items-center justify-between font-medium">
							<p>Negative</p>
							<p className="text-negative-cta">4 (2%)</p>
						</li>
					</ul>
					{/* <Link href={`/users/${router.query.id}?tab=reputation`} passHref>
						<Button
							outline={true}
							compact={true}
							className="w-full justify-center mt-6"
						>
							View all reputation
						</Button>
					</Link> */}
				</Panel>
			</div>
		</div>
	);
};

export default ReputationSubApp;
